import React from 'react';
import Menu from "./components/Menu/Menu";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My React App</h1>
        <p>
            <Menu/>
        </p>
      </header>
    </div>
  );
}

export default App;
